/// items : [{"kind":"books#volume","id":"p3QQjwEACAAJ","etag":"WRbV9QYatMw","selfLink":"https://www.googleapis.com/books/v1/volumes/p3QQjwEACAAJ","volumeInfo":{"title":"Harry Potter and the philosopher's stone","authors":["J. K. Rowling"],"publishedDate":"2010","description":"Harry Potter se ha quedado huérfano y vive en casa de sus abominables tíos y del insoportable primo Dudley. Harry se siente muy triste y solo, hasta que un buen día recibe una carta que cambiará su vida para siempre. En ella le comunican que ha sido aceptado como alumno en el colegio interno Hogwarts de magia y hechicería. A partir de ese momento, la suerte de Harry da un vuelco espectacular. En esa escuela tan especial aprenderá encantamientos, trucos fabulosos y tácticas de defensa contra las malas artes. Se convertirá en el campeón escolar de quidditch, especie de fútbol aéreo que se juega montado sobre escobas, y se hará un puñado de buenos amigos... aunque también algunos temibles enemigos. Pero sobre todo, conocerá los secretos que le permitirán cumplir con su destino. Pues, aunque no lo parezca a primera vista, Harry no es un chico común y corriente. ¡Es un verdadero mago! (Source : 4e de couverture)","industryIdentifiers":[{"type":"ISBN_10","identifier":"8498382661"},{"type":"ISBN_13","identifier":"9788498382662"}],"readingModes":{"text":false,"image":false},"pageCount":254,"printType":"BOOK","categories":["Juvenile Fiction"],"averageRating":4.5,"ratingsCount":8,"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"preview-1.0.0","imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=p3QQjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=p3QQjwEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"es","previewLink":"http://books.google.com.co/books?id=p3QQjwEACAAJ&dq=HarryPoter&hl=&cd=1&source=gbs_api","infoLink":"http://books.google.com.co/books?id=p3QQjwEACAAJ&dq=HarryPoter&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Harry_Potter_and_the_philosopher_s_stone.html?hl=&id=p3QQjwEACAAJ"},"saleInfo":{"country":"CO","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"CO","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=p3QQjwEACAAJ&hl=&source=gbs_api","accessViewStatus":"NONE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"Harry Potter se ha quedado huérfano y vive en casa de sus abominables tíos y del insoportable primo Dudley."}},{"kind":"books#volume","id":"AHaREAAAQBAJ","etag":"ADCgqGUbLo0","selfLink":"https://www.googleapis.com/books/v1/volumes/AHaREAAAQBAJ","volumeInfo":{"title":"Harry Potter y la piedra filosofal (20 Aniv. Gryffindor) / Harry Potter and the Sorcerer's Stone (Gryffindor)","authors":["J.K. Rowling"],"publisher":"National Geographic Books","publishedDate":"2018-12-01","description":"1998-2018: VEINTE AÑOS DE MAGIA Celebra el 20º aniversario de Harry Potter con la edición roja de Gryffindor de Harry Potter y la piedra filosofal Harry Potter se ha quedado huérfano y vive en casa de sus abominables tíos y del insoportable primo Dudley. Harry se siente muy triste y solo, hasta que un buen día recibe una carta que cambiará su vida para siempre. En ella le comunican que ha sido aceptado como alumno en el colegio interno Hogwarts de magia y hechicería. A partir de ese momento, la suerte de Harry da un vuelco espectacular. En esa escuela tan especial aprenderá encantamientos, trucos fabulosos y tácticas de defensa contra las malas artes. Se convertirá en el campeón escolar de quidditch, especie de fútbol aéreo que se juega montado sobre escobas, y se hará un puñado de buenos amigos... aunque también algunos temibles enemigos. Pero sobre todo, conocerá los secretos que le permitirán cumplir con su destino. Pues, aunque no lo parezca a primera vista, Harry no es un chico común y corriente. ¡Es un verdadero mago! ENGLISH DESCRIPTION Exclusive Gryffindor house edition to celebrate the 20th Anniversary of the first publication of Harry Potter and the Sorcerer's Stone – a highly collectable must-have for all Harry Potter fans! Harry Potter is an orphan and lives a miserable life in the home of his abominable aunt and uncle and his unbearable cousin Dudley. Harry feels sad and lonely, until one day he receives a letter that will change his life forever. In it he finds out that he has been accepted as a student at the boarding school Hogwarts School of Witchcraft and Wizardry. From then on, Harry's luck takes a dramatic turn. In that special school he will learn spells, fabulous tricks, and defense tactics against dark forces. He will become the school champion at Quidditch, a kind of aerial soccer played while riding on brooms, and he will make a handful of good friends ... but also some fearsome enemies. But, above all, he will learn the secrets that will allow him to fulfill his destiny. Because, although it may not seem at first glance, Harry is not an ordinary boy. He is a true wizard!","industryIdentifiers":[{"type":"ISBN_13","identifier":"9788498388879"},{"type":"ISBN_10","identifier":"8498388872"}],"readingModes":{"text":true,"image":false},"pageCount":0,"printType":"BOOK","categories":["Juvenile Fiction"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"preview-1.0.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=AHaREAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=AHaREAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"es","previewLink":"http://books.google.com.co/books?id=AHaREAAAQBAJ&dq=HarryPoter&hl=&cd=2&source=gbs_api","infoLink":"http://books.google.com.co/books?id=AHaREAAAQBAJ&dq=HarryPoter&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Harry_Potter_y_la_piedra_filosofal_20_An.html?hl=&id=AHaREAAAQBAJ"},"saleInfo":{"country":"CO","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"CO","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=AHaREAAAQBAJ&hl=&source=gbs_api","accessViewStatus":"NONE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"1998-2018: VEINTE AÑOS DE MAGIA Celebra el 20º aniversario de Harry Potter con la edición roja de Gryffindor de Harry Potter y la piedra filosofal Harry Potter se ha quedado huérfano y vive en casa de sus abominables tíos y del ..."}},{"kind":"books#volume","id":"yHWREAAAQBAJ","etag":"MiLwHv8lLb8","selfLink":"https://www.googleapis.com/books/v1/volumes/yHWREAAAQBAJ","volumeInfo":{"title":"Harry Potter y la piedra filosofal. Edición ilustrada / Harry Potter and the Sorcerer's Stone: The Illustrated Edition","authors":["J.K. Rowling"],"publisher":"National Geographic Books","publishedDate":"2015-10-31","description":"Una maravillosa edición, ilustrada por Jim Kay, del primer volumen de la serie de Harry Potter. La vida de Harry Potter cambia para siempre el día que cumple once años, cuando el gigante de ojos negros y brillantes Rubeus Hagrid le entrega una carta y le revela noticias asombrosas: Harry Potter no es un chico normal y corriente, es un mago. Está a punto de comenzar una aventura extraordinaria... El prestigioso artista británico Jim Kay ha contribuido con su enorme talento en esta primera edición ilustrada del clásico de J.K. Rowling. Un libro maravilloso y cautivador, una obra de gran valor tanto para fans incondicionales como para nuevos lectores. J.K. Rowling ha dicho: «Las ilustraciones de Jim Kay me emocionaron profundamente. Me encanta su interpretación del mundo de Harry Potter, y para mí es un verdadero honor que haya aportado su talento a esta nueva edición.» ENGLISH DESCRIPTION The beloved first book of the Harry Potter series, now fully illustrated by award-winning artist Jim Kay. For the first time, J.K. Rowling's beloved Harry Potter books will be presented in lavishly illustrated full-color editions. Kate Greenaway-award-winning artist Jim Kay has created over 100 stunning illustrations, making this deluxe format a perfect gift as much for a child being introduced to the series, as for the dedicated fan. Harry Potter has never been the star of a Quidditch team, scoring points while riding a broom far above the ground. He knows no spells, has never helped to hatch a dragon, and has never worn a cloak of invisibility. All he knows is a miserable life with the Dursleys, his horrible aunt and uncle, and their abominable son, Dudley -- a great big swollen spoiled bully. Harry's room is a tiny closet at the foot of the stairs, and he hasn't had a birthday party in eleven years. But all that is about to change when a mysterious letter arrives by owl messenger: a letter with an invitation to an incredible place that Harry -- and anyone who reads about him -- will find unforgettable.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9788498387094"},{"type":"ISBN_10","identifier":"8498387094"}],"readingModes":{"text":true,"image":false},"pageCount":0,"printType":"BOOK","categories":["Juvenile Fiction"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"preview-1.0.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=yHWREAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=yHWREAAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"es","previewLink":"http://books.google.com.co/books?id=yHWREAAAQBAJ&dq=HarryPoter&hl=&cd=3&source=gbs_api","infoLink":"http://books.google.com.co/books?id=yHWREAAAQBAJ&dq=HarryPoter&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Harry_Potter_y_la_piedra_filosofal_Edici.html?hl=&id=yHWREAAAQBAJ"},"saleInfo":{"country":"CO","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"CO","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=yHWREAAAQBAJ&hl=&source=gbs_api","accessViewStatus":"NONE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"Kate Greenaway-award-winning artist Jim Kay has created over 100 stunning illustrations, making this deluxe format a perfect gift as much for a child being introduced to the series, as for the dedicated fan."}},{"kind":"books#volume","id":"_-hnPrimlnYC","etag":"wspy7FlGMI4","selfLink":"https://www.googleapis.com/books/v1/volumes/_-hnPrimlnYC","volumeInfo":{"title":"Harry Potter y la cámara secreta","authors":["J. K. Rowling"],"publisher":"Lectorum Publications","publishedDate":"1999","description":"Tras derrotar una vez más a lord Voldemort, su siniestro enemigo en Harry Potter y la piedra filosofal, Harry espera impaciente en casa de sus insoportables tíos el inicio del segundo curso del Colegio Hogwarts de Magia y Hechicería. Sin embargo, la espera dura poco, pues un elfo aparece en su habitación y le advierte que una amenaza mortal se cierne sobre la escuela. Así pues, Harry no se lo piensa dos veces y, acompañado de Ron, su mejor amigo, se dirige a Hogwarts en un coche volador. Pero ¿puede un aprendiz de mago defender la escuela de los malvados que pretenden destruirla? Sin saber que alguien ha abierto la Cámara de los Secretos, dejando escapar una serie de monstruos peligrosos, Harry y sus amigos Ron y Hermione tendrán que enfrentarse con arañas gigantes, serpientes encantadas, fantasmas enfurecidos y, sobre todo, con la mismísima reencarnación de su más temible adversario.","industryIdentifiers":[{"type":"ISBN_10","identifier":"8478884955"},{"type":"ISBN_13","identifier":"9788478884957"}],"readingModes":{"text":false,"image":false},"pageCount":288,"printType":"BOOK","categories":["Brujos"],"averageRating":4,"ratingsCount":125,"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"1.3.3.0.preview.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=_-hnPrimlnYC&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=_-hnPrimlnYC&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"es","previewLink":"http://books.google.com.co/books?id=_-hnPrimlnYC&q=HarryPoter&dq=HarryPoter&hl=&cd=4&source=gbs_api","infoLink":"http://books.google.com.co/books?id=_-hnPrimlnYC&dq=HarryPoter&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Harry_Potter_y_la_c%C3%A1mara_secreta.html?hl=&id=_-hnPrimlnYC"},"saleInfo":{"country":"CO","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"CO","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=_-hnPrimlnYC&hl=&source=gbs_api","accessViewStatus":"NONE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"Tras derrotar una vez más a lord Voldemort, su siniestro enemigo en Harry Potter y la piedra filosofal, Harry espera impaciente en casa de sus insoportables tíos el inicio del segundo curso del Colegio Hogwarts de Magia y Hechicería."}},{"kind":"books#volume","id":"tIZAvgAACAAJ","etag":"O3RKqRKozc8","selfLink":"https://www.googleapis.com/books/v1/volumes/tIZAvgAACAAJ","volumeInfo":{"title":"Harry Potter y la Orden del Fénix","authors":["J. K. Rowling","Gemma Rovira Ortega"],"publisher":"Salamandra Publicacions Y Edicions","publishedDate":"2004-01","description":"Las tediosas vacaciones de verano en casa de sus tíos todavía no han acabado y Harry se encuentra más inquieto que nunca. Apenas ha tenido noticias de Ron y Hermione, y presiente que algo extraño está sucediendo en Hogwarts. En efecto, cuando por fin comienza otro curso en el famoso colegio de magia y hechicería, sus temores se vuelven realidad. El Ministerio de Magia niega que Voldemort haya regresado y ha iniciado una campaña de desprestigio contra Harry y Dumbledore, para lo cual ha asignado a la horrible profesora Dolores Umbridge la tarea de vigilar todos sus movimientos. Así pues, además de sentirse solo e incomprendido, Harry sospecha que Voldemort puede adivinar sus pensamientos, e intuye que el temible mago trata de apoderarse de un objeto secreto que le permitiría recuperar su poder destructivo.","industryIdentifiers":[{"type":"ISBN_10","identifier":"8478887423"},{"type":"ISBN_13","identifier":"9788478887422"}],"readingModes":{"text":false,"image":false},"pageCount":893,"printType":"BOOK","categories":["Juvenile Fiction"],"averageRating":5,"ratingsCount":1,"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"preview-1.0.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=tIZAvgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=tIZAvgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"es","previewLink":"http://books.google.com.co/books?id=tIZAvgAACAAJ&dq=HarryPoter&hl=&cd=5&source=gbs_api","infoLink":"http://books.google.com.co/books?id=tIZAvgAACAAJ&dq=HarryPoter&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Harry_Potter_y_la_Orden_del_F%C3%A9nix.html?hl=&id=tIZAvgAACAAJ"},"saleInfo":{"country":"CO","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"CO","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=tIZAvgAACAAJ&hl=&source=gbs_api","accessViewStatus":"NONE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"Las tediosas vacaciones de verano en casa de sus tíos todavía no han acabado y Harry se encuentra más inquieto que nunca."}},{"kind":"books#volume","id":"8UJaAAAAYAAJ","etag":"z5fnMQHrcHw","selfLink":"https://www.googleapis.com/books/v1/volumes/8UJaAAAAYAAJ","volumeInfo":{"title":"Harry Potter y la piedra filosofal","authors":["J. K. Rowling"],"publisher":"Lectorum Publications","publishedDate":"2001","description":"Harry Potter y la piedra filosofal es el primer volumen de la ya clásica serie de novelas fantásticas de la autora británica J.K. Rowling. «Con las manos temblorosas, Harry le dio la vuelta al sobre y vio un sello de lacre púrpura con un escudo de armas: un león, un águila, un tejón y una serpiente, que rodeaban una gran letra H.» Harry Potter nunca ha oído hablar de Hogwarts hasta que empiezan a caer cartas en el felpudo del número 4 de Privet Drive. Llevan la dirección escrita con tinta verde en un sobre de pergamino amarillento con un sello de lacre púrpura, y sus horripilantes tíos se apresuran a confiscarlas. Más tarde, el día que Harry cumple once años, Rubeus Hagrid, un hombre gigantesco cuyos ojos brillan como escarabajos negros, irrumpe con una noticia extraordinaria: Harry Potter es un mago, y le han concedido una plaza en el Colegio Hogwarts de Magia y Hechicería. ¡Está a punto de comenzar una aventura increíble! ENGLISH DESCRIPTION Harry Potter and the Sorcerer's Stone is the first volume of British author J.K. Rowling's now classic series of fantasy novels. With trembling hands, Harry turned over the envelope and saw a purple wax seal with a coat of arms: a lion, an eagle, a badger, and a snake, all surrounding a large letter H. Harry Potter has never heard of Hogwarts before, until letters start falling at the doorstep of 4 Privet Drive. The address is written in green ink on a yellowed parchment envelope with a purple wax seal stamped on it, and his repugnant aunt and uncle rush to remove and hide them. Later, on Harry's eleventh birthday, Rubeus Hagrid, a gigantic man whose eyes sparkle like black beetles, shows up with extraordinary news: Harry Potter is a wizard, and he has been awarded a place at Hogwarts School of Witchcraft and Wizardry. An incredible adventure is about to begin!","industryIdentifiers":[{"type":"OTHER","identifier":"PSU:000058699409"}],"readingModes":{"text":false,"image":false},"pageCount":272,"printType":"BOOK","categories":["Boarding schools"],"averageRating":5,"ratingsCount":1,"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"0.4.3.0.preview.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=8UJaAAAAYAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=8UJaAAAAYAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"es","previewLink":"http://books.google.com.co/books?id=8UJaAAAAYAAJ&q=HarryPoter&dq=HarryPoter&hl=&cd=6&source=gbs_api","infoLink":"http://books.google.com.co/books?id=8UJaAAAAYAAJ&dq=HarryPoter&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Harry_Potter_y_la_piedra_filosofal.html?hl=&id=8UJaAAAAYAAJ"},"saleInfo":{"country":"CO","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"CO","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=8UJaAAA